    private HashMap<String, HashMap<String, Boolean>> map;

    private CardsSolutionsMap() {
        map = new HashMap<>();
        String[] strs = solutionStr.replaceAll("x", "*")
                .replaceAll("\\](?:\\s*([^\\[]+?))?\\s*(\\[|$)", "]\n$1\n$2").split("\\n");
        String key = null;
        for (String str : strs) {
            if (str.startsWith("[")) {
                key = str;
                continue;
            }
            HashMap<String, Boolean> values = null;
            String[] expressions = str.split(" ");
            if (expressions.length > 0) {
                values = new HashMap<>();
                for (String expression : expressions) {
                    values.put(expression, Boolean.TRUE);
                }
            }
            map.put(key, values);
        }
    }

    public static CardsSolutionsMap getInstance() {
        if (instance == null) {
            instance = new CardsSolutionsMap();
        }
        return instance;
    }

    public boolean hasThisSolution(String numbers, String solution) {
        HashMap<String, Boolean> solutions = map.get(numbers);
        if (solutions == null) {
            return false;
        }
        Boolean has = solutions.get(solution);
        return Boolean.TRUE.equals(has);
    }

    public static void main(String[] args) {
        CardsSolutionsMap instance = getInstance();
        System.out.println(instance.map.get("[2,4,8,10]"));
        System.out.println(instance.hasThisSolution("[2,4,8,10]", ""));
        System.out.println(instance.hasThisSolution("[2,4,8,10]", "(10+2)x8/4"));
    }
